import React, { Component } from "react";
class FormField extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tag: "input",
      name: "yooo",
      type: "text",
      human_label: "First Name",
    };
  }
  render() {
    return (
      <form>
        <p>
          {this.state.human_label}
          <input type="text" name="username" />
        </p>
      </form>
    );
  }
}

export default FormField;
